import logo from './logo.svg';
import './App.css';

const App = () => {
  return (

    <div className="App">
      <div><Header /></div>
      <ul>
        <li>First</li>
        <li>Second</li>
        <li>Third</li>
        <li>Fourth</li>
      </ul>
    </div>
  );
}
const Header = () => {
  return (
    <div>
      <a>Home</a>
      <a>New Page</a>
      <a>Message</a>
    </div>
  );
}

export default App;
